    }

    noCallback = () => {

    }

    render() {

        return (
            <div className="MatchMini">
                <div className="MatchMini__Grid" onClick={ (this.props.clickCallback) ? this.props.clickCallback : this.noCallback }>
                    <div className="MatchMini__Grid__Name">{this.props.name}</div>
